import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

import './Aboutme.css';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'üåç Renuem',
      description: (
        <>
          <p>Renewable energy investment platform.</p>
          <ul>
            <li>
              Developed a renewable energy investment app using React Native
              (Expo) and Node.js with Express.js, enabling individuals to invest
              in wind farms and solar panels through a scalable and secure
              platform.
            </li>
            <li>
              Deployed the backend on AWS, integrating MySQL RDS for efficient
              data management and real-time investment tracking.
            </li>
            <li>
              Collaborated with stakeholders to align the app with business
              goals, driving user engagement and satisfaction.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: 'üíº Clear Ear',
      description: (
        <>
          <p>Hearing clinic appointment management app.</p>
          <ul>
            <li>
              Designed and developed an Android app using React Native to
              manage patient appointments and streamline operations for a
              hearing clinic.
            </li>
            <li>
              Integrated a local database with AsyncStorage to store and track
              customer details and appointment history.
            </li>
            <li>
              Worked closely with clinic staff to gather requirements and
              ensure the app met operational needs and improved workflow
              efficiency.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'üéÆ Mo‚Äôs Pvt',
      description: (
        <>
          <p>Data analysis and digital development.</p>
          <ul>
            <li>
              Conducted data analysis for the launch of bubble tea in Pakistan,
              identifying key demographics and customer segments for targeted
              marketing.
            </li>
            <li>
              Analyzed market trends to assess the possibility of expanding into
              new locations for bubble tea and nitrogen ice cream shops.
            </li>
            <li>
              Developed and maintained the Mo‚Äôs Games website using HTML, CSS,
              and JavaScript, showcasing a variety of games and engaging with
              the gaming community.
            </li>
          </ul>
        </>
      ),
    },
  ];

  return (
    <div className="main">
      <div className="bg">
        <div className="hero-section">
          <img className="wide" src={untitled} alt="Mohammed Bakhshi" />
          <div className="paragraph wide">
            <h1>Hi, I‚Äôm Mohammed Bakhshi!</h1>
            <p>
              I'm a full-stack developer with a passion for building innovative
              and user-friendly applications.
            </p>
          </div>
        </div>

        <div className="logo-container">
          {techLanguages.map((tech) => (
            <div key={tech.id} onMouseEnter={() => handleLogoHover(tech.id)} onMouseLeave={() => handleLogoLeave(tech.id)}>
              <img src={tech.src} alt={tech.name} />
              {tooltipVisible[tech.id] && <div className="tooltip visible">{tech.name}</div>}
            </div>
          ))}
        </div>

        <Typography variant="h4" className="section-header">Work History</Typography>
        <Timeline>
          {workHistory.map((item) => (
            <TimelineItem key={item.id}>
              <TimelineOppositeContent>
                <img className="work-icon" src={item.icon} alt={item.title} />
              </TimelineOppositeContent>
              <TimelineSeparator>
                <TimelineConnector />
              </TimelineSeparator>
              <TimelineContent>
                <Card className="work-history-card">
                  <CardContent>
                    <Typography className="work-title">{item.title}</Typography>
                    <Typography className="work-description">{item.description}</Typography>
                  </CardContent>
                </Card>
              </TimelineContent>
            </TimelineItem>
          ))}
        </Timeline>
      </div>
    </div>
  );
};

export default MainContent;
